import React from 'react';
import { Typography, Box } from '@mui/material';
import MyCard from '../components/MyCard';

function Work( {theme} ) {
    return (
        <div>
            <Typography variant='h4' className='heading' style={{ color: theme.palette.text.primary }}>
                <span>Projects</span>
            </Typography>
            <Box className='content-body'>
                <MyCard title='Sample' content='Lorem ipsum dolor sit amet' link='https://rondeobalos.com' image='./assets/background.webp' />
            </Box>
            
        </div>
    );
}

export default Work;
